import styled from "styled-components";
import MainSecFriend from "./MainSecFriend";
import MainSecFriendImg from "./MainSecFriendImg";
import { Button } from "../Section02/MainSecButtonCTA";
import { GlobalSection } from "../../stylesGlobal";

GlobalSection = styled(GlobalSection)`
    width: 100%;
    margin: 0 auto;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
`

const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    position: relative;
`;

const NewButton = styled(Button)`
    position: absolute;
    top: 97%;
    left: 50%;
    transform: translate(-50%, -50%);
    cursor: pointer;
`;

function Section04() {
    return (
        <SectionCTA>
            <MainSecFriend />
            <MainSecFriendImg />
            <a href="friend">
                <NewButton>Descubre el plan amigo</NewButton>
            </a>
        </SectionCTA>
    )
};

export default Section04;
